[TestMethod()]\n[DeploymentItem("WATrust.Shared.Infrastructure.dll")]\npublic void BuildForeignKeysContainsPredicate_shoud_build_contains_predicate()\n{\n    RemoteEntityRefLoader_Accessor<ReferencedEntity> target = CreateRemoteEntityRefLoader_Accessor();\n\n    List<object> foreignKeys = new List<object>() { 1, 2, 3, 4 };\n    Expression<Func<ReferencedEntity, bool>> expected = (ReferencedEntity referencedEntity) => foreignKeys.Contains(referencedEntity.Id);\n    Expression<Func<ReferencedEntity, bool>> actual = target.BuildForeignKeysContainsPredicate(foreignKeys, "Id");\n\n    // Compile both expressions\n    Func<ReferencedEntity, bool> expectedFunc = expected.Compile();\n    Func<ReferencedEntity, bool> actualFunc = actual.Compile();\n\n    // Create a test instance\n    ReferencedEntity testEntity = new ReferencedEntity { Id = 3 };\n\n    // Assert that both expressions produce the same result\n    Assert.AreEqual(expectedFunc(testEntity), actualFunc(testEntity));\n}